const Card =(props) => {
	return(
		<div className='tc bg-dark-green dib br4 pa1 ma2 grow shadow-5'> 
			<img src={`https://robohash.org/${props.id}?200x200`}/>
			<div>
				//<img src={props.image}/>
				<h2>{props.name}</h2>
				<p>{props.email}</p>
			</div>
		</div>
		);
}

export default Card;
